import {AppProps} from "next/app";

const MyApp = ({Component, pageProps}: AppProps) => {
	// return <Component {...pageProps} />;
	return (
		<div>
			<h1>MyApp</h1>
			<Component {...pageProps} />
		</div>
	);
};

export default MyApp;
